#!/usr/bin/perl
use warnings FATAL =&gt; &#39;all&#39;;

open(DEBUGFILE, &quot;&gt;&gt; /symbox/tmp/ESTexportExcel.log&quot;);
my $local_time=localtime();
my $process_id=&#39;{PROCESS::ID}&#39;;
my $user_login = 56;
my $filename=&#39;{EST_EXport_data_tmp.fileName_export}&#39;; 

$filename =&quot;$filename.xlsx&quot;;


print DEBUGFILE &quot;
================ Exporting EST Avail ================
 Time: $local_time 
=============================================
&quot;;

my $clear_existing_path=&quot;
    UPDATE [EST_Export_tmp]
    SET
        [EST_Export_tmp.internal_file_path]= &#39;&#39;
    WHERE object_id=?
&quot;;
SYMBOX::DB::Sql($clear_existing_path,[$process_id]);

my $export_film_exec=`cd /symbox/solutionscripts && LANG=en_US.UTF-8 java -jar /symbox/solutionscripts/ExcelIO.jar 82 {PROCESS::ID} template=[MRM_TEMPLATE_EST_Avail.template] [EST_Export_tmp.internal_file_path]`;

print DEBUGFILE $export_film_exec;

my $get_system_file_path=&quot;
    SELECT [EST_Export_tmp.internal_file_path] internal_file_path
    FROM [EST_Export_tmp]
    WHERE object_id=?
&quot;;

my $db= SYMBOX::DB::Sql($get_system_file_path,[$process_id]);
my $row = $db-&gt;fetchrow_hashref();
my $internal_path=$row-&gt;{&#39;internal_file_path&#39;};

if(length($row-&gt;{&#39;internal_file_path&#39;})&gt;0){
    my $attachment_id = SYMBOX::DB::gen_id(&#39;tbl_attachments&#39;, &#39;attachment_id&#39;);
    my $system_file_name= $internal_path;
    $system_file_name =~ s/.*\///;

    my $create_new_attachment_entry=&quot;
            INSERT INTO tbl_attachments
            (
                attachment_id,
                filename,
                system_filename,
                description,
                date_added,
                linked_object_type,
                linked_object_id,
                is_public,
                uploaded_by
            )
            VALUES(?,?,?,?,NOW(),11,?,1,?)
    &quot;;

    SYMBOX::DB::Sql($create_new_attachment_entry, [$attachment_id, $filename, $system_file_name, &#39; generated Version Preview&#39;, $process_id,$user_login]);

    my $expose_the_file_name=&quot;
        UPDATE [EST_Export_DownloadFile_tmp]
        SET [EST_Export_DownloadFile_tmp.preview_file] = ? 
        WHERE object_id= ?
    &quot;;

    SYMBOX::DB::Sql($expose_the_file_name, [$system_file_name, $process_id]);
}
else{
    print DEBUGFILE &quot;Failed to create file entry in the attachments table&quot;;
}

	print DEBUGFILE &quot;
	================ End of Export ================
	=============================================
	&quot;;

return 1;

