var accordionController = {
    init: function(dataIn, targetSelectorForSubHeading, hiddenChildrenClass) {
        //expects
        // {
        //     idOfParent : &quot;comma seperated #ids of children&quot;
        // }
        this.refData = dataIn;
        this.hiddenChildrenClass = hiddenChildrenClass;
        jQuery(targetSelectorForSubHeading).on(&quot;click&quot;, this.onClickHandler);

        var accord_heading_ids = Object.keys(this.refData);
        jQuery(&quot;#&quot; &#43; accord_heading_ids[0]).click();
        jQuery.each(accord_heading_ids, function(i, v) {
            jQuery(&quot;#&quot; &#43; v).click();
        });
    },
    onClickHandler: function(event) {
        var _this = accordionController;
        var selectedElem = jQuery(event.target);

        jQuery(_this.refData[selectedElem.attr(&quot;id&quot;)]).toggleClass(_this.hiddenChildrenClass);
    }
};


var validationController = {
    violatedFieldsErrorMessage: &quot;Please update highlighted fields before submitting the form&quot;,
    init: function(controllersList) {
        this.controllersList = controllersList;
        this.isValidationMode = false;
        this.validationViolatedCssClass = &quot;validation-error&quot;;
        // expecting array of objects having following object format
        // {
        //     controllerName:&quot;{name of the controller}&quot;,
        //     minimumCharacterCount:{minimum Character Count in number},
        //     maximumCharacterCount:{maximum Character Count in number},
        //     noWarning:{true or false},
        //     disableCharacterLimiter:{true or false},
        // }
        this.setupCharacterLimiter();
        this.highlightViolatedFields();
    },

    setupCharacterLimiter: function() {
        var _this = this;

        jQuery.each(_this.controllersList, function(i, v) {
            var formControllerObject = objForm.getControlByName(v.controllerName);
            var controllerUID = formControllerObject.uid;
            jQuery(&quot;[name=&#39;user_&quot; &#43; controllerUID &#43; &quot;&#39;]&quot;).on(&quot;input&quot;, function(e) {
                var elem = jQuery(e.target);
                elem.removeClass(_this.validationViolatedCssClass).removeAttr(&quot;title&quot;);
                if (v.disableCharacterLimiter != true) {
                    var errorMessage = &quot;&quot;;
                    // var appliedValue = formControllerObject.getValue();
                    var appliedValue = elem.val();
                    var errorMessageCommon = &quot;character length for &quot; &#43; _this.getControllerLabelValue(controllerUID) &#43; &quot; is &quot;;
                    var errorMessageCommon_2 = &quot;.\\nPlease reduce the character count before submitting.&quot;;

                  //  if (_this.isControllerEditable(v.controllerName)) {
                        if (v.minimumCharacterCount != null &amp;&amp; appliedValue.length &lt; v.minimumCharacterCount) {
                            errorMessage &#43;= &quot;Minimum &quot; &#43; errorMessageCommon &#43; v.minimumCharacterCount;
                            appliedValue = appliedValue.substring(0, v.maximumCharacterCount);
                            elem.addClass(_this.validationViolatedCssClass).attr(&quot;title&quot;, errorMessage);
                            // alert(errorMessage);
                        } else if (v.maximumCharacterCount != null &amp;&amp; appliedValue.length &gt; v.maximumCharacterCount) {
                            errorMessage &#43;= &quot;Maximum &quot; &#43; errorMessageCommon &#43; v.maximumCharacterCount;
                            appliedValue = appliedValue.substring(0, v.maximumCharacterCount);
                            elem.addClass(_this.validationViolatedCssClass).attr(&quot;title&quot;, errorMessage);
                            // formControllerObject.setValue(appliedValue);
                            // if (!_this.isValidationMode &amp;&amp; v.noWarning != true) {
                            //     // alert(errorMessage &#43; errorMessageCommon_2);
                            // }
                      //  }
                    }
                }
            });
        });
    },

    requiredFieldsChecker: function(controllersNameList) {
        var _this = this;
        var returnValue = true;
        jQuery.each(controllersNameList, function(i, v) {
            var objControllerr = objForm.getControlByName(v);
            if (_this.isControllerEditable(v) &amp;&amp; objControllerr.getValue().trim().length == 0) {
                returnValue = _this.getControllerLabelValue(objControllerr.uid);
                return false;
            }
        });
        return returnValue;
    },

    getControllerLabelValue: function(controllerUID) {
        //var controllerlabel = jQuery(&quot;#control_container_&quot; &#43; controllerUID &#43; &quot; span:first&quot;);
	//return controllerlabel.text().trim();

	var controllerlabel = jQuery(&quot;#control_container_&quot; &#43; controllerUID &#43; &quot; span:first&quot;).attr(&#39;label_text&#39;);
        return controllerlabel.trim();
    },

    isControllerEditable: function(controllerName) {
        var objControllerr = objForm.getControlByName(controllerName);
        var elem = jQuery(&quot;[name=&#39;user_&quot; &#43; objControllerr.uid &#43; &quot;&#39;]&quot;);
        return elem.attr(&quot;disabled&quot;) == null &amp;&amp; elem.hasClass(&quot;InputUneditabble&quot;) == false &amp;&amp; elem.attr(&quot;readonly&quot;) == null;
    },

    highlightViolatedFields: function() {
        var _this = this;
        _this.isValidationMode = true;
        jQuery.each(_this.controllersList, function(i, v) {
            jQuery(&quot;[name=&#39;user_&quot; &#43; objForm.getControlByName(v.controllerName).uid &#43; &quot;&#39;]&quot;).trigger(&quot;input&quot;);
        });
        _this.isValidationMode = false;
    },

    hasCharacterCountViolatedFields: function() {
        this.highlightViolatedFields();
        return jQuery(&quot;.&quot; &#43; this.validationViolatedCssClass).length &gt; 0;
    }
};

var customInputControllers = {
    setupCustomDateController: function(controllerName) {
        var controllerInput = jQuery(&quot;[name=&#39;user_&quot; &#43; objForm.getControlByName(controllerName).uid &#43; &quot;&#39;]&quot;);
        controllerInput.attr(&quot;placeholder&quot;, &quot;mm/dd/yy&quot;).attr(&quot;readonly&quot;, true).keyup(function(e) {
            if (e.keyCode == 8 || e.keyCode == 46) {
                jQuery.datepicker._clearDate(this);
            }
        });
        controllerInput.datepicker({
            dateFormat: &#39;mm/dd/y&#39;
        });
    },

    setupCustomDateControllerTest: function(controllerName) {
