    setupCustomDateControllerPair: function(controllerName1, controllerName2) {
        var fController1 = objForm.getControlByName(controllerName1);
        var fController2 = objForm.getControlByName(controllerName2);
        var controllerInput1 = jQuery(&quot;[name=&#39;user_&quot; &#43; fController1.uid &#43; &quot;&#39;]&quot;);
        var controllerInput2 = jQuery(&quot;[name=&#39;user_&quot; &#43; fController2.uid &#43; &quot;&#39;]&quot;);

        controllerInput1.attr(&quot;placeholder&quot;, &quot;mm/dd/yy&quot;).attr(&quot;readonly&quot;, true).keyup(function(e) {
            if (e.keyCode == 8 || e.keyCode == 46) {
                jQuery.datepicker._clearDate(this);
            }
        });
        controllerInput2.attr(&quot;placeholder&quot;, &quot;mm/dd/yy&quot;).attr(&quot;readonly&quot;, true).keyup(function(e) {
            if (e.keyCode == 8 || e.keyCode == 46) {
                jQuery.datepicker._clearDate(this);
            }
        });

        controllerInput1.datepicker({
            dateFormat: &#39;mm/dd/y&#39;,
            changeMonth: true,
            changeYear: true,
            onSelect: function(date) {

                var selectedDate = new Date(date);
                var msecsInADay = 0;
                var endDate = new Date(selectedDate.getTime() &#43; msecsInADay);

                var date2 = new Date(fController2.getValue());

                if (date2 &lt; selectedDate) {
                    date2 = date;
                    controllerInput2.datepicker(&quot;option&quot;, &quot;minDate&quot;, date);
                    fController2.setValue(date2);
                }


                //Set Minimum Date of EndDatePicker After Selected Date of StartDatePicker
                controllerInput2.datepicker(&quot;option&quot;, &quot;minDate&quot;, endDate);
                fController1.setValue(date);

            }
        });

        var endDate = &#39;&#39;;
        if (fController1.getValue() != &#39;&#39;) {
            var selectedDate = new Date(fController1.getValue());
            var msecsInADay = 0;
            endDate = new Date(selectedDate.getTime() &#43; msecsInADay);
        }
        controllerInput2.datepicker({
            dateFormat: &#39;mm/dd/y&#39;,
            changeMonth: true,
            changeYear: true,
            minDate: endDate
        });
    },

