var customTabController = {
    init: function(tabName) {
        var clonedObject;
        var currentTabId = parent.jQuery(&quot;#tabs-container .content-tab-slider:contains(&#39;&quot; &#43; tabName &#43; &quot;&#39;)&quot;).data(&quot;nodeid&quot;);

        if (currentTabId != &quot;&quot;) {
            clonedObject = jQuery.extend({}, this);
            clonedObject.tabId = currentTabId;
            clonedObject.targetRef = parent;

        } else {
            console.log(&quot;Failed to create the clone&quot;);
        }
        return clonedObject;
    },
    closeTab: function() {
        this._handleRequest(&quot;close&quot;);
    },
    refreshTab: function() {
        this._handleRequest(&quot;refresh&quot;);
    },
    doesTheTabExists: function() {
        return this._isExists();
    },
    _handleRequest: function(requestType) {
        if (this.tabId != null) {
            var previousItem;
            var mainTarget = this._getTabId();
            var innerTarget = &quot;.content-tab-closable-R&quot;;
            // if (requestType == &quot;close&quot;) {
            //     previousItem = this.targetRef.jQuery(mainTarget).prev();
            //     if (previousItem.hasClass(&quot;fa-circle&quot;)) {

            //     }
            //     innerTarget = &quot;.content-tab-closable-X&quot;;
            // }
            // this.targetRef.jQuery(mainTarget &#43; &quot; &quot; &#43; innerTarget).click();
            // previousItem.remove();
            if (requestType == &quot;close&quot;) {
                this.targetRef.jQuery(mainTarget).click();
                this.targetRef.jQuery(&quot;#tabs-container #tab-close&quot;).click();
            } else {
                this.targetRef.jQuery(mainTarget &#43; &quot; &quot; &#43; innerTarget).click();
            }

        }
    },
    _getTabId: function() {
        return &quot;#tabs-container-slider #content-tab-&quot; &#43; this.tabId;
    },
    _isExists: function() {
        return this.targetRef.jQuery(this._getTabId()).length &gt; 0;
    }
};


var customFormController = {
    ajaxUpdateForm: function(arrayOfControllers) {
        var formId = jQuery(&quot;[name=&#39;form_id&#39;]&quot;).val();
        var data = {
            form_id: formId,
            process_id: jQuery(&quot;[name=&#39;process_id&#39;]&quot;).val(),
            action: &#39;update_form&#39;,
            run_mode: &#39;inline&#39;,
            form_type: &#39;editable&#39;,
            action_form_id: formId,
            object_id: jQuery(&quot;[name=&#39;object_id&#39;]&quot;).val(),
            object_type: jQuery(&quot;[name=&#39;object_type&#39;]&quot;).val(),
            cache: new Date().getTime()
        };

        jQuery.each(arrayOfControllers, function(i, v) {
            var refController = objForm.getControlByName(v);
            var refUID = refController.uid;
            var refValue = refController.getValue();

            data[&quot;user_&quot; &#43; refUID] = refValue;
            data[refUID] = refValue;
        });

        jQuery.ajax({
            type: &quot;POST&quot;,
            url: &quot;/bpm_update_dataset_endpoint.pl&quot;,
            data: data,
            //if received a response from the server
            success: function(data, textStatus, jqXHR) {
                console.log(&quot;updated controller values&quot;);
            },
            //If there was no resonse from the server
            error: function(jqXHR, textStatus, errorThrown) {
                console.log(&quot;failed to update controller values&quot;);
            }
        });
    }
};
